ORGANSKO seme – Kvalitet i poreklo semena je od izuzetnog značaja u organskoj proizvodnji. Seme treba da je organski gajeno i da potiče iz kraja u kome se nalazi povrtnjak. 
Tada će uz sve ostale mere, prinos povrća i njegov kvalitet biti onakav kakav očekujemo. Seme je začetak male biljke pun hranljivih materija zaštićen tvrdom opnom. Čuvano na suvom ostaće u stanju mirovanja ili živo, odnosno sposobno za klijanje, tokom jedne ili više godina u suvom I hladnom prostoru. Kada se seme izloži dejstvu vlage I toplote, ono počinje da upija vlagu, bubri, pukne i dozvoli klici biljke da počne da raste. Ako koristimo seme iz starih zaliha, obratićemo pažnju na njegovu klijavost. Naime, klijavost semena je ograničena I često zavisi od uslova čuvanja. ORGANSKO seme je uslov sertifikovane organske proizvodnje 
Klijavost nekih najčešće gajenih vrsta povrća: 
1-2 god: kukuruz šećerac, praziluk, vlašac; 
2-3 god: šargarepa, crveni luk, peršun; 
3-4 god: salate, spanać i endivija; 
4-5 god: kupus, radič, rotkvice, cvekla, paradajz; 
5-6 god: boranija, grašak, pasulj, krastavci, tikvice, dinje, celer. ORGANSKO seme je uslov sertifikacije 
Ukoliko nismo sigurni u kvalitet semena za setvu, lako možemo napraviti sledeću probu: Na stakleni tanjir stavimo komadić filter – papira koji smo dobro navlažili vodom. Za to može poslužiti I pamučna vata ili mekaniji peškir. Na navlaženi materijal staviti deset semenki. Tanjir staviti na toplo mesto, stalno održavajući vlažnost. Kod semena dobre klijavosti 7 – 8 semenki bi trebalo da proklija. Ukoliko isklija I 5 semenki, to je još uvek zadovoljavajuća klijavost, tako da isprobano seme može da se koristi. 
